import React from "react";
import "./App.css";
import Row from "./Row";
import requests from "./request";

function App() {
   return (
      <div className="App">
         <h1>Hey Jarvis Lets Build Netflix-Clone! This is Jarvis</h1>
         <Row title="NETLIX ORIGINAL" fetchUrl={requests.fetchNetflixOriginals} />
         <Row title="Treanding Now" fetchUrl={requests.fetchTrending} />
         <Row title="Top Rated" fetchUrl={requests.fetchTopRated} />
         <Row title="Action Movies" fetchUrl={requests.fetchActionMovies} />
         <Row title="Comedy Movies" fetchUrl={requests.fetchComedyMovies} />
         <Row title="Horoo" fetchUrl={requests.fetchTrending} />

      </div>
   );
}

export default App;
